  false,\n\t\"url\": null,\n\t\"notes\": \"This study was conducted on Clarence Cannon
  NWR to help determine and compare any trends in field succession due to various
  manipulations of the moist soil units. Plant species, types, and their relative
  abundance were determined for each of the fields studied. Each plant species was
  ranked and categorized as to (a) the number of plot sites it occurred  on; (b) what
  percentage of the total sites it was found on; (c) how many individual plants of
  each species were found; and (d) what percentage of the total vegetative yield this
  would be for each field.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
